def process_files(user_id):
    file_path = user_data[user_id]['file_path']
    manga_name = user_data[user_id]['manga_name']
    quality = user_data[user_id]['quality']
    channel_id = user_data[user_id]['channel_id']
    cover_image_path = 'jamino.jpg'

    if os.path.exists(file_path):
        with open(file_path, 'r') as file:
            urls = file.readlines()

        remaining_urls = urls.copy()

        def process_next_url():
            nonlocal remaining_urls

            if not remaining_urls:
                bot.send_message(ADMIN_ID, "ÿ™ŸÖ ÿßŸÑÿßŸÜÿ™Ÿáÿßÿ° ŸÖŸÜ ŸÖÿπÿßŸÑÿ¨ÿ© ÿ¨ŸÖŸäÿπ ÿßŸÑÿ±Ÿàÿßÿ®ÿ∑.")
                print("Finished processing all URLs.")
                return

            url = remaining_urls.pop(0).strip()
            if url:
                chapter_part = url.rstrip('/').split('/')[-1]

                if re.match(r'^\d+-\d+$', chapter_part):  # ŸÖÿ´ŸÑ 2-5 ‚Üê 2.5
                    chapter_number = chapter_part.replace('-', '.')
                elif re.match(r'^\d+', chapter_part):  # ŸÖÿ´ŸÑ 3-ÿπŸÜŸàÿßŸÜ ‚Üê 3
                    chapter_number = re.match(r'^\d+', chapter_part).group()
                else:
                    chapter_number = "ÿ∫Ÿäÿ± ŸÖÿπÿ±ŸàŸÅ"


                folder_name = f'{manga_name} chap [{chapter_number}]'
                os.makedirs(folder_name, exist_ok=True)

                response = requests.get(url)
                soup = BeautifulSoup(response.content, 'html.parser')
                images = soup.find_all('img')

                image_files = []
                with concurrent.futures.ThreadPoolExecutor() as executor:
                    futures = []
                    for img_index, img in enumerate(images):
                        img_url = urljoin(url, img['src'])

                        # ÿ™ÿµŸÅŸäÿ© ÿßŸÑÿµŸàÿ±ÿ© ÿ∫Ÿäÿ± ÿßŸÑŸÖÿ±ÿ∫Ÿàÿ® ŸÅŸäŸáÿß
                        if ("mangalek.png" not in img_url and
                            "https://azoramoon.com/wp-content/uploads/2021/08/0d8f1fc1563c802b1f0c89eaa2316f461.png" not in img_url and
                            "https://olympustaff.com/images/TeamX.png" not in img_url):

                            img_name = f'{img_index:04d}.jpg'  # ÿ™ÿ≥ŸÖŸäÿ© ÿßŸÑÿµŸàÿ± ÿ®ÿ™ÿ±ÿ™Ÿäÿ® ÿ±ŸÇŸÖŸä ÿµÿ≠Ÿäÿ≠
                            futures.append(
                                executor.submit(download_image, img_url, folder_name, img_name, quality))

                    for future in concurrent.futures.as_completed(futures):
                        image_path = future.result()
                        if image_path:
                            image_files.append(image_path)

                cover_image_dest_path = copy_cover_image(cover_image_path, folder_name)
                image_files = [cover_image_dest_path] + sorted(image_files)  # ÿ™ÿ±ÿ™Ÿäÿ® ÿßŸÑÿµŸàÿ± ŸÇÿ®ŸÑ ÿ™ÿ≠ŸàŸäŸÑŸáÿß ÿ•ŸÑŸâ PDF
                pdf_file = f'{folder_name}.pdf'
                images_to_pdf(image_files, pdf_file)

                file_size_mb = os.path.getsize(pdf_file) / (1024 * 1024)
                file_size_kb = os.path.getsize(pdf_file) / 1024

                if file_size_mb > MAX_FILE_SIZE_MB:
                        bot.send_message(
                            ADMIN_ID,
                            f"ŸÅÿ¥ŸÑ ŸÅŸä ÿ•ÿ±ÿ≥ÿßŸÑ ÿßŸÑŸÖŸÑŸÅ ÿ®ÿ≥ÿ®ÿ® ÿ≠ÿ¨ŸÖŸá ({file_size_mb:.2f} ŸÖŸäÿ∫ÿßÿ®ÿßŸäÿ™). ÿ£ÿ±ÿ≥ŸÑ 'ÿßŸÉŸÖŸÑ' ŸÑŸÖÿ™ÿßÿ®ÿπÿ© ÿ™ÿ≠ŸàŸäŸÑ ÿßŸÑÿ®ÿßŸÇŸä."
                        )
                        print(f"File size too large: {file_size_mb:.2f} MB")
