# ÿ™ÿπÿ±ŸäŸÅ ÿßŸÑÿØÿßŸÑÿ© download_image
def download_image(image_url, folder_path, image_name, quality):
    try:
        headers = generate_headers()
        response = requests.get(image_url, headers=headers)
        response.raise_for_status()  # ÿßŸÑÿ™ÿ£ŸÉÿØ ŸÖŸÜ ÿ£ŸÜ ÿßŸÑÿ∑ŸÑÿ® ŸÉÿßŸÜ ŸÜÿßÿ¨ÿ≠Ÿãÿß

        image_path = os.path.join(folder_path, image_name)

        with open(image_path, 'wb') as file:
            file.write(response.content)

        # ÿßŸÑÿ™ÿ≠ŸÇŸÇ ŸÖŸÜ ÿµÿ≠ÿ© ÿßŸÑÿµŸàÿ±ÿ© ÿ®ÿπÿØ ÿ™ÿ≠ŸÖŸäŸÑŸáÿß
        with Image.open(image_path) as img:
            img.verify()

        # ŸÅÿ™ÿ≠ ÿßŸÑÿµŸàÿ±ÿ© Ÿàÿ™ÿ≠ŸàŸäŸÑŸáÿß ÿ•ŸÑŸâ RGB ÿ•ÿ∞ÿß ŸÉÿßŸÜÿ™ ÿ¥ŸÅÿßŸÅÿ©
        with Image.open(image_path) as img:
            img = img.convert('RGB')
            img.save(image_path, 'JPEG', quality=quality)

        return image_path
    except Exception as e:
        print(f"Error downloading image {image_url}: {e}")
        return None


# ÿ™ÿπÿ±ŸäŸÅ ÿØÿßŸÑÿ© copy_cover_image
def copy_cover_image(src_path, dest_folder):
    cover_image_dest_path = os.path.join(dest_folder, 'cover_image.jpg')
    shutil.copy(src_path, cover_image_dest_path)
    return cover_image_dest_path


